import React, { useState, useEffect, useRef } from "react";
// import { useNavigate } from "react-router-dom"
const VehicleList = () => {
    const [vehicles, setVehicles] = useState([]);
    const resultData = useRef([]);
    // const navigate = useNavigate();

    useEffect(() => {
        getVehicles();
    }, []);
    const getVehicles = async () => {
        const result = await fetch('http://localhost:5000/api/product')
        const resultData = await result.json();
        setVehicles(resultData);
    }
    // useEffect(() => {
    //     const getVehicles = async () => {
    //         try {
    //             const result = await fetch('http://localhost:5000/api/product', {
    //                 method: 'get',
    //                 headers: {
    //                     'Content-Type': 'application/json'
    //                 }
    //             });

    //             const data = await result.json();

    //             console.log('Fetched data:', data);

    //             if (Array.isArray(data)) {
    //                 resultData.current = data;
    //                 setVehicles(data);
    //             } else {
    //                 console.error('Invalid data format:', data);
    //             }
    //         } catch (error) {
    //             console.error('Error fetching data:', error);
    //         }
    //     };

    //     getVehicles();
    // }, []);

    console.warn("vehicles", vehicles);
    const handleEdit = () => {
        // navigate('/editvehicle?{result._id}');
    }
    const deleteProduct = (id) => {
        console.warn(id);
    }

    return (
        <form className="inline-grid mt-28 rounded-xl justify-center bg-stone-200">
            <div className="mt-2">
                <h1 className='text-center font-bold text-2xl text-stone-600'>User Details</h1>
            </div>
            <div>
                <table className='border-collapse border border-slate-950 my-5'>
                    <thead className="text-base">
                        <tr>
                            <th className='px-1 border border-slate-800 '>S.N</th>
                            <th className='px-1 border border-slate-800 '>Vehicle Name</th>
                            <th className='px-1 border border-slate-800 '>Category</th>
                            <th className='px-1 border border-slate-800 '>Image</th>
                            <th className='px-1 border border-slate-800 '>RegistrationNo</th>
                            <th className='px-1 border border-slate-800 '>Quntity</th>
                            <th className='px-1 border border-slate-800 '>Rent Price</th>
                            <th className='px-1 border border-slate-800 '>Reviews Rating</th>
                            <th className='px-1 border border-slate-800 '>Reviews Number</th>
                            <th className='px-1 border border-slate-800 '> Description</th>
                            <th className='px-1 border border-slate-800 '>Actions</th>
                        </tr>
                    </thead>
                    <tbody className="text-xs">
                        {vehicles.map((item, index) =>
                            <tr key={item._id}>
                                <td className='px-1 border border-slate-700'>{index + 1}</td>
                                <td className='px-1 border border-slate-700'>{item.name}</td>
                                <td className='px-1 border border-slate-700'>{item.category}</td>
                                <td className='px-1 border border-slate-700'>{item.image}</td>
                                <td className='px-1 border border-slate-700'>{item.registrationNo}</td>
                                <td className='px-1 border border-slate-700'>{item.countInStock}</td>
                                <td className='px-1 border border-slate-700'>{item.price}</td>
                                <td className='px-1 border border-slate-700'>{item.rating}</td>
                                <td className='px-1 border border-slate-700'>{item.numReviews}</td>
                                <td className='px-1 border border-slate-700'>{item.description}</td>
                                <td className='px-1 border border-slate-700 text-white'>
                                    <button onClick={() => handleEdit(item._id)} className='mx-1 bg-stone-600 rounded-xl px-2 font-medium hover:bg-stone-700 hover:font-bold'>Edit</button>
                                    <button onClick={() => deleteProduct(item._id)} className='mx-1 bg-red-600 rounded-xl px-2 font-medium hover:bg-red-700'>Delete</button>
                                </td>
                            </tr>
                        )}
                    </tbody>
                </table>
            </div>
        </form>
    );
};

export default VehicleList;
